func main() {
	santa(input())
}

func santa(input string) int {
	openBracket := strings.Count(input, "(")
	closedBracket := strings.Count(input, ")")

	floor := openBracket - closedBracket
	fmt.Println("Floor:", floor)

	return floor
}

